// SearchBar.js
import React from 'react';

const SearchBar = ({ handleSearch }) => {
  return (
    <div>
      <input type="text" placeholder="Buscar por nombre..." onChange={(e) => handleSearch(e.target.value)} />
    </div>
  );
};

export default SearchBar;
